-- =============================================
-- Author:   Grupo OIM de Ministerio del Interior - Vilma Rodriguez
-- Create date:		21/11/2017
-- Modified date:	21/11/2017
-- Description:		Obtiene los datos del precargue de entidades nacionales por el derecho
-- =============================================
alter PROC [PAT].[C_PrecargueEntidadesNacionales] ( @IdDerecho INT,@IdTablero tinyint , @IdMunicipio int)
AS
BEGIN
	select IdDerecho,Componente,Medida,Programa,EntidadNacional,CantidadEjecutada,E.IdMunicipio, M.Nombre AS Municipio , D.Nombre as Departamento
	from PAT.PrecargueEntidadesNacionales as E
	join Municipio as M on E.IdMunicipio =M.Id
	join Departamento as D on M.IdDepartamento = D.Id
	where E.IdDerecho =  @IdDerecho 
	and E.IdTablero = @IdTablero
	and E.IdMunicipio =@IdMunicipio
END

go

